def expansion(D):
    """Etend les 32 bits du bloc DO en 48 bits dans Q"""
    E=[32, 1, 2, 3, 4, 5,
        4, 5, 6, 7, 8, 9,
        8, 9,10,11,12,13,
       12,13,14,15,16,17,
       16,17,18,19,20,21,
       20,21,22,23,24,25,
       24,25,26,27,28,29,
       28,29,30,31,32, 1]
    Q = [D[i-1] for i in E]
#    print("expansion: ",Q)
    return Q

def XOR(b1,b2):
    """OU exclusif entre 2 bits b1 et b2"""
    if b1==1:
        if b2==1:
            return 0
        else:
            return 1
    elif b2==1:
        return 1
    else:
        return 0

def XORL(Dprime,K):
    """Ou exclusif entre Dprime et clé K (48 bits)"""
    D0 = []
    for i in range(len(Dprime)):
        D0.append(XOR(Dprime[i], K[i]))
    return D0

