def DESc(M, K):
    """ Crypte le message M (binaire de 64 bits) avec la clé K (binaire de 64 bits) par la methode du DES"""
    #Verification
    if checkBINn(M, 64) == False: return 'Erreur M'
    if checkBINn(K, 64) == False: return 'Erreur K'

    #Calcul des cles
    key = genKey(K)

#    print("-----------------------------------------------")

    #permutation initiale
    MPI = permutation_initiale(M)
#    print()

    #scindement
    G,D =  scindement2(MPI)
#    print("G=", G)
#    print("D=", D)
#    print()
#    print()

    #initialisation de la ronde
    Gi = G
    Di = D
#    print("i= *")
#    print()
#    print("G * =", Gi)
#    print("D * =", Di)
#    print()
#    print()

    #ronde
    for i in range(16):
#        print("i=", i)
#        print()
        Dexpand= expansion(Di)
        Xi = XORL(Dexpand, key[i])
#        print("XORL",i,"=", Xi)
        Si = selection(Xi)
        Ti = permutation32(Si)
        Gi, Di = Di,  XORL(Gi, Ti)
#        print()
#        print("G",i,"=", Gi)
#        print("D",i,"=", Di)
#        print()
#        print()

    #regroupement INVERSE
    R = Di + Gi

    #permutation inverse
    return permutation_inverse(R)



def DESd(M, K):
    """ Decrypte le message M (binaire de 64 bits) avec la clé K (binaire de 64 bits) par la methode du DES"""
    #Verification
    if checkBINn(M, 64) == False: return 'Erreur M'
    if checkBINn(K, 64) == False: return 'Erreur K'

    #Calcul des cles
    key = genKey(K)
    key.reverse()

#    for j in range(len(key)):
#        print("K.r",j,"=",key[j])
#        print()

#    print("-----------------------------------------------")

    #permutation initiale
    MPI = permutation_initiale(M)
#    print()

    #scindement
    G,D =  scindement2(MPI)
#    print("G=", G)
#    print("D=", D)
#    print()
#    print()

    #initialisation de la ronde
    Gi = G
    Di = D
#    print("i= *")
#    print()
#    print("G * =", Gi)
#    print("D * =", Di)
#    print()
#    print()

    #ronde
    for i in range(16):
#        print("i=", i)
#        print()
        Dexpand= expansion(Di)
        Xi = XORL(Dexpand, key[i])
#        print("XORL",i,"=", Xi)
        Si = selection(Xi)
        Ti = permutation32(Si)
        Gi, Di = Di,  XORL(Gi, Ti)
#        print()
#        print("G",i,"=", Gi)
#        print("D",i,"=", Di)
#        print()
#        print()

    #regroupement INVERSE
    R = Di + Gi

    #permutation inverse
    return permutation_inverse(R)

